import React from 'react';
import history from '../History';
import {
 Navbar,
 Nav,
 NavDropdown,
 Form,
 FormControl,
 Button,
} from "react-bootstrap";//導入需要的component

export default function Nbar (account) { 
    return (
      <Navbar bg="light" expand="lg">
         <Navbar.Brand href="/">Data sharing platform</Navbar.Brand>
         <Navbar.Toggle aria-controls="basic-navbar-nav" />
         <Navbar.Collapse id="basic-navbar-nav">
           <Nav className="mr-auto">
              <Nav.Link href="/Request">Data request</Nav.Link>
              <Nav.Link href="/Create">Create member</Nav.Link>
           </Nav>
         </Navbar.Collapse>
          <ul className="navbar-nav px-3">
            <li className="nav-item text-nowrap d-none d-sm-none d-sm-block">
              <small className="text-white"><span id="account">{account}</span></small>
            </li>
          </ul>
      </Navbar> 
    );
}
